import React from 'react';

function Collect() {
  let meta;
  fetch('https://gateway.pinata.cloud/ipfs/QmU5bwaw1crBiUcbRmFCwQHkHJX9bM2fA3hC1uaEiVvSdP')
  .then(res => res.json())
  .then((out) => {
    console.log(out);
    meta = out
  })
  .catch(err => {
    throw err
  });


  return (
    <div className="App">
      <div>{meta}</div>
    </div>
  );
}

export default Collect;
